    @Getter private final String[] commands;
    @Getter private final Material material;
    @Getter private final String name;
    @Getter private final String skin;
    @Getter private final int modelData;


    public ItemStack getItem() {
        ItemStack item = modelData > 0 ? BukkitUtils.getCustomItem(material, name, null, modelData, true) : BukkitUtils.getItem(material, name, null, skin, true);
        ItemMeta itemMeta = item.getItemMeta();
        PersistentDataContainer dataContainer = itemMeta.getPersistentDataContainer();
        dataContainer.set(new NamespacedKey(GoldmanMysteryBox.getPlugin(), "key"), PersistentDataType.STRING, name());
        item.setItemMeta(itemMeta);
        return item;
    }

